import React, { Component} from 'react';
import  InputRange  from './InputSlider';


class noValueSlider extends Component {
    constructor(props) {
        super(props)
        this.state = {
            value: [0, 50, 100]
        }
    }
    render() {
        return (
            <form className="form"> 
            {this.state.value.map((data,i) =>    
                <InputRange min={0} max={100} value ={data.value} />
            )}
            </form>
        );
    }
}


export default noValueSlider;
